import "./Navbar.css";
import { NavLink} from "react-router-dom";
import React, { useState, useEffect } from 'react';
import { googleLogout, useGoogleLogin } from '@react-oauth/google';

function Navbar(prop) {
  const [showSignup, setShowSignup] = useState(false);
  const [user, setUser] = useState([]);
  const [profile, setProfile] = useState([]);
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark Navbar-main">
      <div className="container-fluid mx-2">
        <a className="navbar-brand nb" href="/">
          {/* <img src="./Media logos/SANKALP SHIKSHA ICON.png" alt="" srcset="" /> */}
          <div>
            The Connect <br />
            <p>Dot Corp.</p>
          </div>
        </a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav ms-auto mb-2 mb-lg-0">
            <li className="nav-item mg">
              <NavLink className="nav-link" aria-current="page" to="/">
                Home
              </NavLink>
            </li>
            <li className="nav-item mg">
              <a className="nav-link" aria-current="page" href="">
                Mentor
              </a>
            </li>
            <li class="nav-item dropdown">
              <a class="nav-link dropdown-toggle" href="#" id="navbarDropdown" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                Mentee
              </a>
              <ul class="dropdown-menu" aria-labelledby="navbarDropdown">
                <li><a class="dropdown-item" target="_blank" href="https://forms.gle/XS8EsPMFcRtWpVLc8">Mentorship</a></li>
                <li><a class="dropdown-item" target="_blank" href="https://docs.google.com/forms/d/e/1FAIpQLSfklrhqx5fDBs4R805we3U1tjkAyn36xoNYjjZcTuyxYYeZtw/viewform?usp=sf_link">Apprenticeship</a></li>
                <li><hr class="dropdown-divider"/></li>
                <li><a class="dropdown-item" target="_blank" href="https://docs.google.com/forms/d/e/1FAIpQLSdbC0OZnMtjKy2fmFYY394HvAMWVTz7Ylm-5DjCkCV9M6G9Ig/viewform?usp=sf_link">Internship</a></li>
              </ul>
            </li>
            <li className="nav-item mg">
              <a className="nav-link" href="#Contact">
                Contact
              </a>
            </li>
          </ul>
          <button type="button" className="btn btn-warning bttn" onClick={Signup}>
            {/* <a href="/Signup">Login</a> */}
            Login
          </button>
          
        </div>
      </div>
    </nav>
  );
}

function Signup() {

  const login = useGoogleLogin({
      onSuccess: (codeResponse) => setUser(codeResponse),
      onError: (error) => console.log('Login Failed:', error)
  });

  useEffect(
      () => {
          if (user) {
              fetch(`https://www.googleapis.com/oauth2/v1/userinfo?access_token=${user.access_token}`, {
                  headers: {
                      Authorization: `Bearer ${user.access_token}`,
                      Accept: 'application/json'
                  },
                  type: "GET"
              })
                  .then(async (res) => {
                      var data = await res.json()
                      setProfile(data);
                  })
                  .catch((err) => console.log(err));
          }
      },
      [user]
  );

  const logOut = () => {
      googleLogout();
      setProfile(null);
  };
  
  return (
      
      <div>
          <h2>React Google Login</h2>
          <br />
          <br />
          {profile ? (
              <div>
                  <img src={profile.picture} alt="user" />
                  <h3>User Logged in</h3>
                  <p>Name: {profile.name}</p>
                  <p>Email Address: {profile.email}</p>
                  <br />
                  <br />
                  <button onClick={logOut}>Log out</button>
              </div>
          ) : (
              <button onClick={() => login()}>Sign in with Google 🚀 </button>
          )}
          
      </div>
      
      
  );
  
}

export default Navbar;
